package com.bns.DataClass;public class DateDB {	private String word;	private int count;	private String match;	private String mean;		public String getMean()	{		return mean;	}		public void setMean(String mean)	{		this.mean = mean;	}	public String getWord() {		return word;	}		public void setWord(String word) {		this.word = word;	}		public int getCount() {		return count;	}		public void setCount(int count) {		this.count = count;	}		public String getMatch() {		return match;	}		public void setMatch(String match) {		this.match = match;	}		public DateDB() {		super();	}		public DateDB(String word, String mean, int count, String match) {		super();		this.word = word;		this.count = count;		this.match = match;		this.mean = mean;	}}